import * as React from 'react';
import SvgIcon from '@mui/material/SvgIcon';

export default function SitemarkIcon() {
  return (
    <SvgIcon
      sx={{
        height: 21,
        width: 120,
        mr: 2,
      }}
      viewBox="0 0 120 21"
    >
      <text
        x="0"
        y="15"
        fill="currentColor"
        fontSize="16"
        fontWeight="bold"
        fontFamily="monospace"
      >
        &lt;/&gt; Portfolio
      </text>
    </SvgIcon>
  );
}
